import WaitingParty from './WaitingParty';
import { useState } from 'react';

function WaitingList({ parties }) {
  const [currentParties, setCurrentParties] = useState(parties);

  const onDelete = targetId => {
    const remainingParties = currentParties.filter((party) => {
      return party.id !== targetId;
    });

    setCurrentParties(remainingParties);
  };

  const renderedParties = currentParties.map((party) => {
    return (
      <WaitingParty reference={party} onDelete={onDelete} />
    );
  });

  return (
    <div className="box-border bg-purple-500 p-5">
      TableCheck
      {renderedParties}
    </div>
  );
}

export default WaitingList;
